#include<bits/stdc++.h>
#include <NTL/ZZ.h>
using namespace std;
using namespace NTL;

ZZ modulo(ZZ a, ZZ b)
{
    ZZ r;
    r = a - b * (a / b);
    r = r + (r < 0) * b;
    return r;
}

ZZ ltrk(ZZ base, ZZ exp, ZZ mod)
{
    ZZ t(1);
    while (exp > 0)
    {
        if (modulo(exp, ZZ(2)) != 0)
            t = modulo((t * base),mod);

        base = modulo((base * base),mod);
        exp = exp>>1;
    }
    return modulo(t,mod);
}

int main()
{
    ZZ base, exp, mod, res;
    base = conv<ZZ>("");
    exp = conv<ZZ>("");
    mod = conv<ZZ>("45");

    res = ltrk(base, exp, mod);
    cout << res;
    return 0;
}
